import React from "react";
import { Link } from "react-router-dom";

const CompanyList = ({ companies }) => {
  if (!companies || companies.length === 0) {
    return <p>No companies found.</p>;
  }

  return (
    <div className="container">
      <div className="row">
        {companies.map((company) => (
          <div className="col-md-4 mb-4" key={company.id}>
            <div className="card">
              <div className="card-body">
                <div className="row">
                  <div className="col-4">
                    <img
                      src={company.logo}
                      alt={company.name}
                      className="img-fluid rounded-circle"
                      style={{ maxHeight: "100px" }}
                    />
                  </div>
                  <div className="col-8">
                    <h5 className="card-title">{company.name}</h5>
                    <p className="card-text">{company.address}</p>
                    <p className="card-text">{company.email}</p>
                    <p className="card-text">{company.contacts}</p>
                    <p className="card-text">{company.fax}</p>
                    <p className="card-text">{company.category}</p>
                    <Link to={`/companies/${company.id}`} className="btn btn-primary">
                      View Details
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CompanyList;
